import React, { useEffect } from "react";
import { useGoogleLogin } from "@react-oauth/google";
import "./WelcomePage.css";
function WelcomePage({ onLogin, onSignup, errorMessage, clearError }) {
  const login = useGoogleLogin({
    onSuccess: (credentialResponse) => {
      clearError(); // Clear the error message before login
      onLogin(credentialResponse);
    },
    onError: (error) => console.error("Login failed:", error),
  });

  const signup = useGoogleLogin({
    onSuccess: (credentialResponse) => {
      clearError(); // Clear the error message before signup
      onSignup(credentialResponse);
    },
    onError: (error) => console.error("Signup failed:", error),
  });

  // Automatically clear the error message when the component unmounts
  useEffect(() => {
    return () => {
      clearError();
    };
  }, [clearError]);

  return (
    <div className="welcome-page">
      <h1>Welcome to TooturAI</h1>
      <p>Please log in or sign up to get started!</p>
      {errorMessage && <p className="error-message">{errorMessage}</p>}
      <div className="buttons">
        <button onClick={login}>Login</button>
        <button onClick={signup}>Sign Up</button>
      </div>
    </div>
  );
}

export default WelcomePage;
